export default ({
  Vue, // VuePress 正在使用的 Vue 构造函数
  options, // 附加到根实例的一些选项
  router, // 当前应用的路由实例
  siteData, // 站点元数据
  isServer // 当前应用配置是处于 服务端渲染 或 客户端
}) => {
  // 用于监控在路由变化时检查广告拦截器 (to主题使用者：你可以去掉本文件的所有代码)
  if (!isServer) {
    router.beforeEach((to, from, next) => {
      next();
      //check if wwads' fire function was blocked after document is ready with 3s timeout (waiting the ad loading)
      docReady(function () {
        if(localStorage.getItem("cdn")==="ankio"){
          let intval = setInterval(()=>{
            let imgs =  document.getElementsByTagName("img");
            if(imgs.length!==0){
              clearInterval(intval);
              for (let j = 0;j<imgs.length;j++){
                //  更换成自己的cdn加速
                imgs[j].src=imgs[j].src.replace("https://cdn.jsdelivr.net/gh/dreamncn/picBed@master","http://image.ankio.net")
              }
            }
          },100)
        }

        let intval2 = setInterval(()=>{
          let as =  document.getElementsByTagName("a");
          if(as.length!==0){
            clearInterval(intval2);
            for (let j = 0;j<as.length;j++){
              //  更换成自己的cdn加速
              if(as[j].href.startsWith("javascript")){
                as[j].removeAttribute("target")
              }
            }
          }
        },100)
      });

      // // 删除事件改为隐藏事件
      // setTimeout(() => {
      //   const pageB = document.querySelector('.pageB');
      //   if (!pageB) return;
      //   const btnEl = pageB.querySelector('.wwads-hide');
      //   if (btnEl) {
      //     btnEl.onclick = () => {
      //       pageB.style.display = 'none';
      //     }
      //   }
      // }, 1000);

      // // 显示广告模块
      // const pageB = document.querySelector('.pageB');
      // if (pageB) {
      //   pageB.style.display = 'flex';
      // }
    })
  }
}


